//App.js
import React from "react";
import './App.css';
import Toast from 'react-hot-toast';
import Login from "./Vistas/Login";
import Salir from "./Vistas/Salir";
import Home from "./Vistas/Home";
import Usuarios from "./Vistas/Usuarios";
import Libros from "./Vistas/Libros";
import Menu_usuario from "./components/Menu_usuario";
import Permisos from "./Vistas/Permisos";
import {
    BrowserRouter as Router,
    Route,
    Link,
    Routes,
    Outlet,
} from "react-router-dom";

import { Navbar, Nav } from "react-bootstrap";
import { Toaster } from 'react-hot-toast';

function NotFound() {
    return (
        <div>
            <h2>No se pudo encontrar la pagina</h2>
            <p>Lo sentimos, la seccion que estas tratando de cargar no existe.</p>
        </div>
    );
}

function redirect() {
    try {
        setTimeout(() => {
            document.cookie = 'error=true';
            window.location = 'http://localhost:3000/Login';
        }, 2500);
    } catch (error) {
error_mensaje('Ocurrio un error en el redirect');
    }

}

function error_mensaje(titulo_mensaje) {
    Toast.error(
        titulo_mensaje,
        {
            duration: 2000,
        }
    );
}

function App() {
    return (
        <Router>
            <Navbar bg="dark" expand="lg">
                <Navbar.Brand>
                    <h1 className="ml-3 text-green">LibroWiki</h1>
                </Navbar.Brand>
                <Toaster
                    position="bottom-right"
                    reverseOrder={false}
                />
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link className="text-white" as={Link} to="/Home" exact>
                            Inicio
                        </Nav.Link>
                     <Menu_usuario error_mensaje={error_mensaje}></Menu_usuario>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

            <div className="container mt-4">
                <h2 id="titulo_app" className="ml-3 text-center card mayus" >Inicio</h2>
                <Routes>
                    <Route path="/" element={<Outlet />}>
                        <Route path="/" element={<Home />} />
                        <Route path="/Home" element={<Home />} />
                        <Route path="/Salir" element={<Salir />} />
                        <Route path="/Libros" element={<Libros redirect={redirect} error_mensaje={error_mensaje} />} />
                        <Route path="/Usuarios" element={<Usuarios redirect={redirect}  error_mensaje={error_mensaje} />} />
                        <Route path="/Permisos" element={<Permisos redirect={redirect}  error_mensaje={error_mensaje} />} />
                        <Route path="/Login" element={<Login error_mensaje={error_mensaje} />} />
                        <Route path="*" element={<NotFound />} />
                    </Route>
                </Routes>
            </div>
            <Navbar className="footer" bg="dark" expand="lg">
                <Navbar.Brand>
                    <h2 className="ml-3 text-green" >Tp de Elizabeth Denett</h2>
                </Navbar.Brand>
            </Navbar>
        </Router>

    );

}
export default App;
